import React, { Component } from "react";
import Question from './Question'
import "./App.css";

class Questions extends Component {

    constructor(props) {
        super(props);
        this.state = {
            question: true
        };
    }

    render() {
        return (
            <div>
                {this.state.questions.map((question, i) => 
                <Question></Question>
                )}
            </div>
        );
    }
}

export default Questions;
